style.css:
@-moz-document domain("truyencuatui.net") {
.category-span {
    color: #ca2a2a !important; }

.list-group-item-0 a {
    color: #b1b1b1; }

.list-group-item-1 a {
    color: #d9534f; }

.list-group-item-2 a {
    color: #ff5722; }

.list-group-item-3 a {
    color: #009688; }

.list-group-item-4 a {
    color: #03a9f4; }

.navbar-collapse, .row, .breadcrumb, .list-group, .panel-body, .jumbotron, .pager li > a {
    background-color: #181818 !important; }

.list-group-item:active, .list-group-item:hover, .list-group-item a:hover {
    background-color: #252525 !important; }

.dropdown-menu {
    padding: 1px 0; }

.bo-truyen .list-group .list-group-item span {
    color: #b1b1b1; }

.bo-truyen .panel-heading,footer,.btn-fbcmts,.btn-share {
    display: none; }

body {
    color: #b1b1b1;
    background-color: #181818 !important;
    padding-bottom: 0; }

.jumbotron {
    margin-bottom: 0 !important; }
hr {border-top:0}
}
